import Vue from "vue";
import Router from 'vue-router'

Vue.use(Router);
export default new Router({
  routes: [
    {
      path: "/",
      component: () => import("@/views/datosAxios/pruebaAxios1.vue"),
      children: [
        {
          path: "axios1", // sin la barra inicial
          name: "axios1",
          meta: { title: "Consumiendo datos por axios" },
          component: () => import("@/views/datosAxios/pruebaAxios1.vue"),
        },
      ]
    }
  ]
});
